import {
  Grid,
  Card,
  CardContent,
  CardActions,
  Typography,
  Button
} from "@mui/material";
import Chart from "react-apexcharts";

const Revenue = ()=>{
  const design = (
    <>
      <Grid item xs={12} sm={6}>
      <Card>
      <CardContent>
      <Typography gutterBottom variant="h5" component="div">
          Revenue Updates
      </Typography>
      </CardContent>

      </Card>
      </Grid>
    </>
  );
  return design;
}

export default Revenue;
